import { Input } from 'semantic-ui-react'

const AddProductToCart = () => {
	return (
		<Input
			type='number'
			min='1'
			placeholder='Quantity'
			value='1'
			action={{ color: 'orange', content: 'Add to Cart', icon: 'plus cart' }}
		/>
	)
}

export default AddProductToCart
